  [],\n\t\"revision_timestamp\": \"2016-07-27T23:04:48.978229\",\n\t\"name\": \"species-status-assessment-report-for-the-page-springsnail\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Page springsnail is a small hydrobiid
  snail that is currently found in a complex of springs along Oak Creek and Spring
  Creek in Yavapai County, central Arizona. Members of the family Hydrobiidae are
  strictly aquatic and often occur in abundance within suitable spring habitats. The
  Page springsnail has been a candidate for listing under the Endangered Species Act
  of 1973, as amended (Act), since 1989 (54 FR 554). The Species Status Assessment
  (SSA) framework is intended to be an in-depth review of the speciesu2019 biology
  and threats, an evaluation of its biological status, and an assessment of the resources
  and conditions needed to maintain longterm viability. The intent is for the SSA
  Report to be easily updated as new information becomes available and to support
  all functions of the Endangered Species Program from Candidate Assessment to Listing
  to Consultations to Recovery. As such, the SSA Report will be a living document
  upon which other documents, such as listing rules, recovery plans, and 5-year reviews,
  would be based if the species warrants listing under the Act.This SSA Report for
  the Page springsnail is intended to provide the biological support for the decision
  on whether to propose to list the species as threatened or endangered and, if so,
  whether to and where to propose designating critical habitat. Importantly, the SSA
  Report does not result in a decision by the Service on whether this taxon should
  be proposed for listing as a threatened or endangered species under the Act. Instead,
  this SSA Report provides a review of the available information strictly related
  to the biological status of the Page springsnail. The listing decision will be made
  by the Service after reviewing this document and all relevant laws, regulations,
  and policies, and the results of a proposed decision will be announced in the Federal
  Register, with appropriate opportunities for public input.\",\n\t\"license_title\":
